var tipuesearch = {"pages":[{"title":"About","text":"cmsimde 內容管理系統 倉儲: https://github.com/mdecycu/cmsimde_site 網站: https://mde.tw/cmsimde_site/ 簡報: https://mde.tw/cmsimde_site/reveal 網誌: https://mde.tw/cmsimde_site/blog","tags":"misc","url":"./pages/about/"},{"title":"41123240網誌-17","text":"2024 Spring 第十七週網址撰寫. 第十七週網誌 項目一 零件圖檔案 項目二 組合圖檔案 項目三 python程式碼檔案 場景檔案 心得 這三項任務我遇到的問題不少，也花了不少時間解決，在一開始的畫圖也是對軟體不太熟悉，許多地方都畫得不佳，在設計上也是零食在課堂上設計得，錄影、開檔案等等繁瑣的小事也是慢慢詢問身旁的同學來得出答案，其中nx開不了檔案，或是錄影檔案位置遺失之類的問題，許多同學都有遇到，不過在重複操作一次問題又會消失，不理解是軟體的問題還是什麼問題，但我也是幸運，只有遇到一次，並順利在課堂上完成項目一與二，帶有空時我試著用Coppliasim來模擬我的圖，也不太了解，慢慢看youtube的教學叫出連桿並連接上去，也詢問同學到要開碰撞與質量，也須設定質量的參數，花了不少時間，後續還有遇到程式碼不能按go，詢問老師後發現是檔案名問題，最終也順利解決，按wasd車子即可旋轉。","tags":"w17 41123240","url":"./w17-41123240.html"},{"title":"41123240網誌-15","text":"2024 Spring 第十五週網址撰寫. 第十五週網誌 這週新增了期末這週新增了分組期末報告，要使用NX繪製零件圖籃框，再導入CoppeliaSim，編寫指令使我們來操縱裡面的人物來做我們指定的動作，這課題似乎有些難度，雖然我們會繪圖，但編寫CoppeliaSim對於我們大家都還是生疏了許多，值得挑戰。目前我們組的進度還處於組合零件圖導入CoppeliaSim，需要趕一下進度。","tags":"w15 41123240","url":"./w15-41123240.html"},{"title":"41123240網誌-14","text":"2024 Spring 第十四週網址撰寫. 第十四週網誌 這週繼續作先前幾週的任務，各組照著自己的進度行動，大家的速度都不同，我們這組算是中間值，做到了用CoppeliaSim模擬足球場，還有組合前幾週的NXopen零組件，再導入CoppeliaSim，照目前的作業量與進度來說，期末作業有機會如期完成。","tags":"w14 41123240","url":"./w14-41123240.html"},{"title":"41123240網誌-13","text":"2024 Spring 第十三週網址撰寫. 第十三週網誌 這週延續上週未完成的作業，上週繪製nx open圖，花費的時間比較多，這週只要照著老師步驟開啟檔案，先下載該組當時的倉儲資料, 並參考網際手足球機器人場景設計專案報告, 讓同學分別擔任場上球員, 再利用鍵盤跨操控足球機器人進行比賽，只要照著老師打的內容來開啟檔案，一步一腳印，這項作業不會消耗太多時間，開啟後他會自己比賽，我放著模擬到大比分。 模擬圖片檔案","tags":"w13 41123240","url":"./w13-41123240.html"},{"title":"41123240網誌-12","text":"2024 Spring 第十二週網址撰寫. 第十二週網誌 NX零件圖-4 零件檔案-4 繪製影片 心得 這週出了繪製nx零件圖，並且組裝起來的任務，由於零件數量不少，所以我們分工合作繪製零件，剛好我分配到的零件是其中最簡單的，相較於其他人花費的時間是比較少的，可以把時間用來應付其他報告，在繪製的過程要使用NX錄製，也是慢慢摸索，遇到許多問題，畢竟是不熟悉的繪圖軟體，在與同學一起討論還有詢問老師各種細項，最後也是順利完成。","tags":"w12 41123240","url":"./w12-41123240.html"},{"title":"41123240網誌-11","text":"2024 Spring 第十一週網址撰寫. 第十一週網誌 在這週新增了許多東西不僅是建立各班學員的倉儲、網站與分組連結或是鋼球平衡台 PID 控制與模擬等作業，又新增了一個評分網站，整班人員要一起更新是非常困難的，並且無法用同一台電腦來一次更新，許多同學都撞在一起，屢次更新不了，課堂的難度漸漸增加，對所有人無疑是一道難題。","tags":"w11 41123240","url":"./w11-41123240.html"},{"title":"41123240網誌-10","text":"2024 Spring 第十週網址撰寫. 第十週網誌 這周下大雨也有很多同學沒到課但課堂進度還是要進行下去，這週新增了許多作業與訊息，例如replit可以用來維護分組倉儲這種消息在沒用codespaces的人也可以維護群組倉儲。 W10協同資料處理 from browser import window, ajax def fetch_csv_data(): url = \"https://mdecd2024.github.io/2bstud-2bsite/downloads/2b.txt\" def on_complete(req): if req.status == 200 or req.status == 0: content = req.text lines = content.split('\\n') for line in lines: if line.strip() == \"\": continue items = line.split(',') if len(items) >= 3: github_username_1 = items[1].strip() # 第二個逗號後到第三個逗號前的數據 team = items[2].strip() # 第三個逗號後的數據 team2 = items[2].strip() github_url_1 = f\"個人倉儲:https://github.com/{github_username_1}/cd2024\" team = f\"分組倉儲:https://github.com/mdecd2024/2b-midbg{team}\" team2 = f\"分組網頁:https://mdecd2024.github.io/2b-midbg{team2}\" csv_data = items[1].strip() # 取得 CSV 中第三個逗號後的資料 github_io_url = f\"個人網頁:https://{csv_data}.github.io/cd2024/\" line_with_urls = f\"{line.strip()},{github_url_1},{github_io_url},{team},{team2}\" # 以逗號分隔的資料串 print(line_with_urls) else: print(\"Error:\", req.text) req = ajax.ajax() req.bind('complete', on_complete) req.open('GET', url, True) req.set_header('content-type', 'application/x-www-form-urlencoded') req.send() fetch_csv_data()","tags":"w10 41123240","url":"./w10-41123240.html"},{"title":"41123240網誌-9","text":"2024 Spring 第九週網址撰寫. 第九週網誌 期中報告影片","tags":"w9 41123240","url":"./w9-41123240.html"},{"title":"41123240網誌-8","text":"2024 Spring 第八週網址撰寫. 第八週網誌 上週清明連續假期休息沒進進度，在統整之前得進度，在分組網站的協同大部分的組別都有卡住的問題，網誌許多地方要改名，一個重複就會造成整個進度大卡住，也有遇到更新了但卻沒抓到我們檔案的問題，在這部分在這部分也是花了很多時間在解決問題。","tags":"w8 41123240","url":"./w8-41123240.html"},{"title":"41123240網誌-7","text":"2024 Spring 第七週網址撰寫. 第七週網誌 這週是第七週，在連續假期期間，因此沒有上課，各組組員各自回顧課程內容重點，把先前幾個禮拜得作業盡力趕出來。","tags":"w7 41123240","url":"./w7-41123240.html"},{"title":"41123240網誌-6","text":"2024 Spring 第六週網址撰寫. 第六週網誌 這週與上週一樣，主要是看各組的進度，看是在翻譯論文還是製作影片字幕，也有教新的，使用NX，Sourcetree 與 CoppeliaSim 設定檔案與管理分組倉儲的權限，再存至可攜系統，並分別從可攜系統啟動後的命令列中啟動，來做之後畫圖的準備。","tags":"w6 41123240","url":"./w6-41123240.html"},{"title":"41123240網誌-5","text":"2024 Spring 第五週網址撰寫. 第五週網誌 這週要統整各組員的網誌進入群組倉儲，並且幫影片上字幕，大部分得同學在個人網誌的更改上都有不少問題，例如很多標題都不能相同，一個相同可能就上傳不了，會被其他東西覆蓋，在處理這些問題就花了不少時間，而且每週REPLIT都有改動，非常複雜。 影片 逐字稿 逐字稿-5 逐字稿-6 心得 這兩部影片在描述使用github建立群組倉儲的過程，並且適用可攜程式來維護我們的倉儲，這樣可以提供良好的隔離性和安全性，從而保護我們的開發環境不受外部干擾，也可以確保各個組員都可以對倉儲進行維護與更新，使分工更加明確。","tags":"w5 41123240","url":"./w5-41123240.html"},{"title":"41123240網誌-01","text":"2024 Spring 第一周網址撰寫. 第一周網誌 建立github倉儲與replit連結，並且增設網誌，設定github雙重認證，下載可攜套件檔案。這些內容都與上學期的大同小異，只有往制式之前沒學過得，第一周來說還算過得去跟得上進度。","tags":"w01 41123240","url":"./w01-41123240.html"},{"title":"41123240網誌-3","text":"2024 Spring 第三週網址撰寫. 第三週網誌 將組員的個人倉儲加入分組倉儲成為子模組，再用replit維護群組倉儲，目前開始漸漸越來越有挑戰，要建立的東西蠻多的，稍微跟不上進度，要用多餘的時間來看影片製作。","tags":"w3 41123240","url":"./w3-41123240.html"},{"title":"41123240網誌-4","text":"2024 Spring 第四週網址撰寫. 第四週網誌 翻譯報告內容，學習如何使用replit檢視靜態網站，突如其來的改動讓我們又要多學另一種檢視方式，讓我了解到程式語言是隨時都在改動，淘汰沒跟上的人。","tags":"w4 41123240","url":"./w4-41123240.html"},{"title":"41123240網誌-2","text":"2024 Spring 第二週網址撰寫. 第二週網誌 利用 Github Classroom 指定分組倉儲，建立ssh-key，將公鑰送到 Github ，在 .ssh 目錄中建立 config，組長將各組員加入群組倉儲。","tags":"w2 41123240","url":"./w2-41123240.html"},{"title":"41123240網誌-1","text":"2024 Spring 網際內容管理與協同產品設計實習課程教學導引. 內容管理系統 使用者可以自行利用 cmsimde_site 倉儲作為 Template, 建立自己的網站內容管理系統. 引用網站網址連結的方法: cmsimde_site - 在文章中多次引用同一個網站連結時, 可以使用此種方法. https://github.com/mdecycu/cmsimde_site - 假如想要快速將網址套用 html 網站連結, 可以使用此種方法. cmsimde_site - 也可以使用 Markdown 的標準網站連結使用格式. # 引用 Python 程式的方法 for i in range(10): print(i, \"列出字串\") 也可以直接在 .md 檔案中使用 html 標註, 或加入 Javascript 或 Brython 程式碼. 從 1 累加到 100: 1 add to 100 將 iterable 與 iterator 相關說明 , 利用 Brython 與 Ace Editor 整理在這個頁面. Filename: .py Run Output 清除輸出區 清除繪圖區 Reload 從 1 累加到 100 part2: 1 add to 100 cango_three_gears BSnake AI Tetris Rotating Block Filename: .py Run Output 清除輸出區 清除繪圖區 Reload","tags":"w1 41123240","url":"./w1-41123240.html"}]};